==Loot==
{{Main|Treasure Trails#Rewards}}

Looting a lucky impling gives players one roll on the drop table of an [[clue scroll (easy)|easy]], [[clue scroll (medium)|medium]], [[clue scroll (hard)|hard]], [[clue scroll (elite)|elite]], or [[clue scroll (master)|master clue scroll]]. There is an equal chance of rolling into each tier's clue scroll table.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1159178762455519232|date=1 October 2016|archiveurl=https://archive.fo/kH8SY|archivedate=8 August 2019|quote=It rolls the easy, medium, hard, elite or master clue lists with equal chance of each.}}

At current [[Grand Exchange]] prices, catching a lucky impling gives {{NoCoins|{{ImpValue|Lucky}} round 0|c}} worth of loot, on average.

There is also a chance of obtaining a clue scroll as a tertiary drop when catching a lucky impling.

