==Rarity==
The chance of a Lucky impling spawning in [[Puro-Puro]] is 1/301. In Gielinor, the spawn rate is 1/101.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/863355929772920832|date=13 May 2017|archiveurl=https://archive.fo/TJqoz|archivedate=8 August 2019|quote=1/101, or 1/301 in the maze.}} These rates make the Lucky impling about nine times rarer than a [[Dragon impling]] in Puro-Puro, and ten times rarer in Gielinor.

